import './App.css';
import axios from "axios";
import React, { useState, useEffect } from "react";

const UserProfile = () => {

  const [userProfile, setUserProfile] = useState([]);

  const fetchUserProfile = () => {

    axios.get("http://localhost:8080/api/v1/users/1").then(res => {
      console.log(res);
      setUserProfile(res.data);
    });

  }

  useEffect(() => {
    fetchUserProfile();
  }, []);


  return (
    <div id="user-info-wrapper" >
      <h1>User Information</h1>
    </div>


  );

};


function App() {
  return (
    <div className="App">
      <div className="createAccountSection">
        <h1 className='text-2xl font-bold'>Create new account</h1>
        <div className='flex flex-row space-x-40'>
          <div className='pl-'>
            <div className='font-semibold pl-3'>User Id</div>
            <input className='bg-[#BDB7E7] rounded-full text-white text-xl border-transparent' />
          </div>
          <div>
            <div className='font-semibold pl-3'>Initial amount</div>
            <input className='bg-[#BDB7E7] rounded-full text-white text-xl border-transparent' />
          </div>
        </div>
      </div>
      <div className="userInformationSection">
        <div className='inputUserId'>
          <h1>User Information</h1>
          <div>User ID</div>
        </div>
        <div className='userInfoDisplay'>
          <div>Name</div>
          <div>Marcos</div>
          <div>Surname</div>
          <div>Riverola</div>
          <div className="accounts">
            <div className='account'></div>
          </div>
        </div>
      </div>


    </div>
  );
}

export default App;
